import { CardsContainer } from "../Styles/Card.style";
import ReactPlayer from "react-player";

const cards = ["https://www.youtube.com/watch?v=o3q35XrW2Jk&t=1s","https://www.youtube.com/watch?v=7TKQLxZ-d_0",]



export const Cards = () => {
return(
<>
        {
            cards.map((card)=> (
                <CardsContainer >
                <ReactPlayer
                controls
                url={card}
                height="100%"
                width="100%"
                className='react-player'


              />
               <Cardmarqueetext >
            <div className="marqueeText">
            {card.title}
            </div>
          </Cardmarqueetext>
                  </CardsContainer>
            ))
        }

    </>
)
}
